// const { Component } = require("react")

import React, { Component } from "react";
import USERS from './data/users';

export const Stocks = () => {
  return (
    <div>
      <HomePageHeader />
      <div className="user-container">
        {USERS.map((USER, key) => {
          return (
            <div key={key}>
                name={USER.name}
                gender={USER.gender}
                signups={USER.signups}
                investment={USER.investment}
                meetingTime={USER.meetingTime}
                exits={USER.exits}
              </div>
          );
        })}
      </div>
    </div>
  );
};

const HomePageHeader = () => {
  return (
    <header className="header">
      <h2>Latest Signups</h2>
    </header>
  );
};

USERS = ({ name, gender, signups, investment, meetingTime, exits }) => {
  if (!name) return <div />;
  return (
    <table>
      <tbody>
        <tr>
          <td>
            <h5>{name}</h5>
          </td>
          <td>
            <h5>{gender}</h5>
          </td>
          <td>
            <h4>{signups}</h4>
          </td>
          <td>
            <p>{investment}</p>
          </td>
          <td>
            <p>{meetingTime}</p>
          </td>
          <td>
            <p>{exits}</p>
          </td>
        </tr>
      </tbody>
    </table>
  );
};
